/**
 * Time series is the most common type of data available, and consists of a collection of data points over a period of time. Time series data is indexed by a single date field, and can be retrieved by any portion of time.
 *
 * https://iexcloud.io/docs/api/#time-series
 *
 * @param {object} options
 * @param {string} options.id ID used to identify a time series dataset.
 * @param {string} options.key Key used to identify data within a dataset. A common example is a symbol such as AAPL.
 * @param {string} options.subkey The optional subkey can used to further refine data for a particular key if available.
 * @param {string} options.range Returns data for a given range. Supported ranges described below.
 * @param {boolean} options.calendar Used in conjunction with range to return data in the future.
 * @param {number} options.limit Limits the number of results returned. Defaults to 1.
 * @param {number} options.offset Offsets the number of results returned. Defaults to 0.
 * @param {string} options.subattribute Allows you to query time series by any field in the result set. All time series data is stored by ID, then key, then subkey. If you want to query by any other field in the data, you can use subattribute.
 *                              For example, news may be stored as /news/{symbol}/{newsId}, and the result data returns the keys id, symbol, date, sector, hasPaywall
 *                              By default you can only query by symbol or id. Maybe you want to query all news where the sector is Technology. Your query would be:
 *                              /time-series/news?subattribute=source|WSJ
 *                              The syntax is subattribute={keyName}|{value}. Both the key name and the value are case sensitive. A pipe symbol is used to represent âequal toâ.
 * @param {string} options.dateField All time series data is stored by a single date field, and that field is used for any range or date parameters. You may want to query time series data by a different date in the result set. To change the date field used by range queries, pass the case sensitive field name with this parameter.
 *                           For example, corporate buy back data may be stored by announce date, but also contains an end date which youâd rather query by. To query by end date you would use dateField=endDate&range=last-week
 * @param {string} options.from Returns data on or after the given from date. Format YYYY-MM-DD
 * @param {string} options.to Returns data on or before the given to date. Format YYYY-MM-DD
 * @param {string} options.on (Returns data on the given date. Format YYYY-MM-DD
 * @param {number} options.last Returns the latest n number of records in the series
 * @param {number} options.first Returns the first n number of records in the series
 * @param {string} options.sort order of results, either ASC or DESC
 * @param {number} options.interval return every nth record
 * @param {object} standardOptions
 * @param {string} standardOptions.token Access token
 * @param {string} standardOptions.version API version
 * @param {string} standardOptions.filter https://iexcloud.io/docs/api/#filter-results
 * @param {string} standardOptions.format output format *
 *     Date Ranges:
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | today        | Returns data for today                                                                                                                     |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | yesterday    | Returns data for yesterday                                                                                                                 |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | ytd          | Returns data for the current year                                                                                                          |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | last-week    | Returns data for Sunday-Saturday last week                                                                                                 |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | last-month   | Returns data for the last month                                                                                                            |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | last-quarter | Returns data for the last quarter                                                                                                          |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | d            | Use the short hand d to return a number of days. Example: 2d returns 2 days. If calendar=true, data is returned from today forward.        |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | w            | Use the short hand w to return a number of weeks. Example: 2w returns 2 weeks. If calendar=true, data is returned from today forward.      |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | m            | Use the short hand m to return a number of months. Example: 2m returns 2 months. If calendar=true, data is returned from today forward.    |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | q            | Use the short hand q to return a number of quarters. Example: 2q returns 2 quarters. If calendar=true, data is returned from today forward.|
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | y            | Use the short hand y to return a number of years. Example: 2y returns 2 years. If calendar=true, data is returned from today forward.      |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | tomorrow     | Calendar data for tomorrow. Requires calendar=true                                                                                         |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | this-week    | Calendar data for Sunday-Saturday this week. Requires calendar=true                                                                        |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | this-month   | Calendar data for current month. Requires calendar=true                                                                                    |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | this-quarter | Calendar data for current quarter. Requires calendar=true                                                                                  |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | next-week    | Calendar data for Sunday-Saturday next week. Requires calendar=true                                                                        |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | next-month   | Calendar data for next month. Requires calendar=true                                                                                       |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 *     | next-quarter | Calendar data for next quarter. Requires calendar=true                                                                                     |
 *     +--------------+--------------------------------------------------------------------------------------------------------------------------------------------+
 */
export const timeSeries = (
  options,
  { token, version, filter, format } = {},
) => {
  const {
    id = "",
    key = "",
    subkey = "",
    range = "",
    calendar = false,
    limit = 1,
    offset = 0,
    subattribute = "",
    dateField = "",
    from = "",
    to = "",
    on = "",
    last = 0,
    first = 0,
    sort = "",
    interval = 0,
    overrideBase = "",
  } = options || {};

  if (!id) return timeSeriesInventory({ token, version, filter, format });

  let base_url = `${overrideBase || "time-series"}/${id}`;
  if (key) base_url += `/${_quoteSymbols(key)}`;
  if (subkey) base_url += `/${_quoteSymbols(subkey)}`;

  base_url += "?";

  if (range) base_url += `range=${_dateRange(range)}&`;

  base_url += `calendar=${calendar.toString()}&`;

  if (!last && (!to || !from)) base_url += `limit=${limit}&`;
  if (offset > 0) base_url += `offset=${offset}&`;
  if (subattribute) base_url += `subattribute=${subattribute}&`;
  if (dateField) base_url += `dateField=${dateField}&`;
  if (from) base_url += `from=${_strOrDate(from)}&`;
  if (to) base_url += `to=${_strOrDate(to)}&`;
  if (on) base_url += `on=${_strOrDate(on)}&`;
  if (last) base_url += `last=${last}&`;
  if (first) base_url += `first=${first}&`;
  if (sort) {
    if (["asc", "desc"].indexOf(sort.toLowerCase()) < 0)
      throw new IEXJSException(`Sort must be in (asc, desc), got: ${sort}`);
    base_url += `sort=${sort}&`;
  }

  if (interval) base_url += `interval=${interval}&`;

  // TODO
  // if extra_params:
  //     base_url += "&".join("{}={}".format(k, v) for k, v in extra_params.items())
  return _get({
    url: base_url,
    token,
    version,
    filter,
    format,
  });
};

Client.prototype.timeSeries = function (options, standardOptions) {
  return timeSeries(options, {
    token: this._token,
    version: this._version,
    ...standardOptions,
  });
};
