const convertOptionsSymbolsToList = (underlyingSymbol, data) => {
  const ret = [];
  if (!underlyingSymbol) {
    Object.keys(data).forEach((symbol) => {
      data[symbol].forEach((date) => {
        ret.push(`${symbol}-${date}`);
