export const _runSSE = (
  method,
  symbols,
  on_data,
  nosnapshot,
  { token, version } = {},
) => {
  if (!method) {
    throw new IEXJSException("method cannot be blank");
  }

  if (symbols) {
    if (version === "sandbox") {
      return _streamSSE(
        _SSE_URL_PREFIX_SANDBOX(
          version,
          method,
          _strCommaSeparatedString(symbols),
          token,
        ),
        on_data,
        nosnapshot,
      );
    }
    return _streamSSE(
      _SSE_URL_PREFIX(
        version,
        method,
        _strCommaSeparatedString(symbols),
        token,
      ),
      on_data,
      nosnapshot,
    );
  }
  if (version === "sandbox") {
    return _streamSSE(
      _SSE_URL_PREFIX_ALL_SANDBOX(method, token),
      on_data,
      nosnapshot,
    );
  }
  return _streamSSE(
    _SSE_URL_PREFIX_ALL(version, method, token),
    on_data,
    nosnapshot,
  );
};

